import React, {useState, useEffect} from "react";
import './App.css';

function Shop() {
  useEffect(() => {
    fetchitems();
  },[]);
  const fetchitems = async () => {
    const data = await fetch(
      'https://fortnite-api.theapinetwork.com/upcoming/get'
      );
      const items = await data.json();
    console.log(items);
  }
  return (
    <div>
      <h1>Shop Pages</h1>
    </div>
  );
}

export default Shop;
